import './App.css';
import Box from '@material-ui/core/Box';
import TextF from '@material-ui/core/Box';


function App() {
  return (
    <body>
      <Box id="signInCard" color='primary'>
        <p>Sign In</p>
        <hr></hr>
        <Textfield defaultValue="Enter your username..."></Textfield>
      </Box>
    </body>
  );
}

export default App;
